            <Row>
              <Col size="12">
                <div
                  className="white "
                  id="search-heading"
                  style={{
                    // marginTop: "5%",
                    paddingBottom: "5px",
                    marginLeft: "5px"
                  }}
                >
                  <div className="" id="search-title">
                    {/* <img className="img" src={OM} /> */}
                    <h4 className="center">My Yoga Journey </h4>
                    <ClientResultBio />
                    {/* {this.renderclientProfBio()} */}
                    {/* <p
                        style={{
                          marginLeft: "50px"
                        }}
                      >
                        Here is how it all began:
